import React from "react"
import Badges from '../partials/user/Badges.js'


const UserProfile = (props) => {

    return (
      <>
        <h2>User Profile</h2>
        <h4> Hello {props.user_name}</h4>
        <Badges 
          user_id={props.user_id}
        />
      </>
    );
}

export default UserProfile
